import React from "react";
import {
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  Dot,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";
import "./SlickCard.css";
import { baseUrlForImg } from "../baseUrl/baseUrl";

const SlickCard = ({ images }) => {
  console.log(images);
  return (
    <CarouselProvider
      naturalSlideWidth={150}
      naturalSlideHeight={150}
      totalSlides={3}
      className="row"
    >
      <Slider>
        {/* {images &&
          images.map((img, index) => (
            <Slide index={index} key={index}>
              <div className="image-box">
                <ImageWithZoom
                  className="image-box-img"
                  src={baseUrlForImg + img.path}
                />
              </div>
            </Slide>
          ))} */}
        <Slide index={0}>
          <div className="image-box">
            <ImageWithZoom
              className="image-box-img"
              src={baseUrlForImg + images[0].path}
            />
          </div>
        </Slide>

        <Slide index={1}>
          <div className="image-box">
            <ImageWithZoom
              className="image-box-img"
              src={baseUrlForImg + images[0].path}
            />
          </div>
        </Slide>

        <Slide index={2}>
          <div className="image-box">
            <ImageWithZoom
              className="image-box-img"
              src={baseUrlForImg + images[0].path}
            />
          </div>
        </Slide>

        <Slide index={3}>
          <div className="image-box">
            <ImageWithZoom
              className="image-box-img"
              src={baseUrlForImg + images[0].path}
            />
          </div>
        </Slide>

        <Slide index={4}>
          <div className="image-box">
            <ImageWithZoom
              className="image-box-img"
              src={baseUrlForImg + images[0].path}
            />
          </div>
        </Slide>
      </Slider>
      <div className="dots col s2 fullWidth">
        {images &&
          images.map((img, index) => (
            <Dot slide={index} key={index} className="slider-dot">
              <img src={baseUrlForImg + img.path} alt="" />
            </Dot>
          ))}
      </div>
    </CarouselProvider>
  );
};

export default SlickCard;
